import React from 'react';
import logo from './logo.svg';
import './App.css';

class App extends React.Component
{
  render()
  {
    return (
      <div>
      <h2>hellllooo</h2>
      <video src={`https://www.youtube.com/watch?v=o6wMCkY7kjA`} autoPlay="true" loop="true"></video>
      </div>
    )
  }
}

export default App;
